@mixin Font_Montserat($size, $weight, $height, $color){
  font-family: Montserrat-Regular, sans-serif;
  font-style: normal;
  font-weight: $weight;
  font-size: $size;
  line-height: $height;
  color: $color;
}

body{
  position: absolute;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  margin: 0 auto;
  padding-left: calc(50% - 190px);
  padding-top: 19px;
}

.search_room {
  width: 320px;
  height: 604px;
  padding: 40px 29px 0 29px;

  border: 1px solid rgba(0, 0, 0, 0.12);
  border-radius: 4px;
  box-shadow: 0 0 25px rgba(0, 0, 0, 0.2);
  background: white;

  margin: 0 auto;

  h2 {
    font-family: Open-Sans, sans-serif;
    line-height: 30px;
    margin: 0;
  }
}

.mail_container{
  margin-top: 19px;
  margin-bottom: 8.44px;
}

.enter_email{
  @include Font_Montserat(14px, normal, 18px, rgba(31, 0, 0, 0.25));
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;


  height: 44px;
  width: 320px;
  padding: 0 14px;
  border: 1px solid rgba(31, 32, 65, 0.25);
  box-sizing: border-box;
  border-radius: 4px;
  margin-top: 5px;
  margin-bottom: 10px;

}

.radio_container{
  margin-top: 3px;
  height: 24px;
  display: flex;
  flex-direction: row;
  justify-content: flex-start;
}

.container {
  display: block;
  position: relative;
  padding-left: 30px;
  margin-right: 20px;
  cursor: pointer;

  @include Font_Montserat(14px, normal, 20px, rgba(31, 32, 65, 0.75));

  input {
    position: absolute;
    opacity: 0;
    cursor: pointer;
  }
}

.checkmark {
