}

.container .checkmark:after {
  top: 3px;
  left: 3px;
  width: 12px;
  height: 12px;
  border-radius: 50%;
  background: linear-gradient(180deg, #BC9CFF 0%, #8BA4F9 100%);
}

.arrive {
  margin-top: 20px;

  h3 {
    @include Font_Montserat(12px, 900, 15px, #1F2041);
    text-transform: uppercase;
    margin: 0;
  }
}

.date{
  display: flex;
  flex-direction: column;
  margin-top: 15px;
  .arrive,.leave{
    display: flex;
    flex-direction: column;
    align-items: flex-start;
  }
}



.confirm {
  @include Font_Montserat(12px, bold, 15px, white);
  display: flex;
  flex-direction: row;
  align-items: center;

  text-align: center;
  text-transform: uppercase;

  width: 320px;
  height: 44px;
  padding-left: 42px;
